import React from 'react'
import Welcome from './Welcome'
import { tsImportEqualsDeclaration } from '@babel/types'

class App extends React.Component {
  constructor (props) {
    super(props)
    this.state = {
      date: new Date()
    }
  }

  tick () {
    this.setState()
  }

  render () {
    return (
      <div>
        <h1>Hello World</h1>
        <h2>It is {this.state.date.toLocaleTimeString()}.</h2>
      </div>
    )
  }
}

export default App
